    [],nt"revision_timestamp": "2016-07-27T22:20:18.272613",nt"name": "stillwater-national-wildlife-refuge-including-stillwater-wildlife-management-area-fallon-n",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Fallon,
    Stillwater, and Anaho Island National Wildlife Refuges outlines Refuge accomplishments
    during the 1996 calendar year. The report begins with a summary of the year's highlights
    and weather conditions. Land acquisition is covered. The report includes a planning
    section which discusses the master plan, public participation, and research and
    investigations. Refuge administration is outlined; information about personnel,
    volunteer programs, funding, and technical assistance is given. Habitat management
    is also covered; subjects include wetlands, forests, croplands, grasslands, grazing,
    fire management, pest control, and water rights. The wildlife section of the report
    discusses wildlife diversity, endangered and threatened species, waterfowl, marsh
    birds and waterbirds, shorebirds, raptors, game mammals, fisheries resources, scientific
    collections, marking and bird banding, and disease control. The public uses of the
    Refuge described in this report include outdoor classrooms, interpretive programs,
    hunting, fishing, trapping, wildlife observation, outdoor recreation, and law enforcement.
    The equipment and facilities section of the report provides information about new
    construction, rehabilitation, major maintenance, equipment replacement, and computer
    systems. Cooperative programs are provided at the end.",nt"license_title":
